import React from "react";
import "../stylesheets/Club.scss";

const Club = () => {
  return (
    <li className="list__item">
      <i className={props.icon} />
      <div>
        <h2 className=" item__title">{props.name}</h2>{" "}
        <p item__members> Members: {props.members}</p>
      </div>
    </li>
  );
};

export default Club;
